PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT DISTINCT ?zone ?zoneLabel ?prop ?propLabel WHERE {
  ?zone a std:Zone .
  OPTIONAL { ?zone rdfs:label ?zoneLabel . }

  { ?zone std:hasProperty ?prop . }
  UNION {
    ?zone std:hasDomainSpace+ ?intermediate .
    ?intermediate a std:RoomDomainSpace .
    ?intermediate (std:hasProperty|std:hasDomainSpace|std:connectedThrough|std:connected|std:cnx)* ?prop .
    FILTER EXISTS {
      ?prop a ?propClass .
      FILTER(?propClass IN (
        std:QuantifiableObservableProperty,
        std:QuantifiableActuatableProperty,
        std:EnumeratedObservableProperty,
        std:EnumeratedActuatableProperty
      ))
    }
  }
  OPTIONAL { ?prop rdfs:label ?propLabel . }
}
ORDER BY ?zoneLabel ?propLabel

